import logo from './logo.svg';
import './App.css';

const Greetings = (props) => <div>Hey you! {props.firstName} {props.lastName}!</div>;

function App() {
  return (
    <div>
      <Greetings firstName="John" lastName="Smith" />
    </div>
  );
}

export default App;
